"use strict";(self.webpackChunkblog_vuepress_next=self.webpackChunkblog_vuepress_next||[]).push([[7766],{2955:(n,s,a)=>{a.r(s),a.d(s,{data:()=>e});const e={key:"v-47d8323e",path:"/views/front-end/look-at-the-lines-of-code.html",title:"查看代码行数",lang:"en-US",frontmatter:{title:"查看代码行数",categories:["Code"],tags:["Code"],keywords:"Code",description:"查看代码行数",cover:"https://cdn.jsdelivr.net/gh/LeeDebug/PicGo/img/20210305125935.png",date:"2021-03-01T12:51:35.000Z"},excerpt:"",headers:[],git:{createdTime:163785445e4,updatedTime:163785445e4,contributors:[{name:"licc",email:"961150665@qq.com",commits:1}]}}},2212:(n,s,a)=>{a.r(s),a.d(s,{default:()=>p});const e=(0,a(6252).uE)('<blockquote><p>项目写久了，就像看看自己一个项目的真实代码有多少行，所以找了下面两个方法</p></blockquote><h1 id="命令行查看" tabindex="-1"><a class="header-anchor" href="#命令行查看" aria-hidden="true">#</a> 命令行查看</h1><p>用mac终端自带的的find命令，可以查看目录下每个文件的行数，及最后输出总行数</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token comment"># input &gt;</span>\n<span class="token function">find</span> <span class="token builtin class-name">.</span> <span class="token string">&quot;(&quot;</span> -name <span class="token string">&quot;*.vue&quot;</span> -or -name <span class="token string">&quot;*.html&quot;</span> -or -name <span class="token string">&quot;*.ts&quot;</span> -or -name <span class="token string">&quot;*.js&quot;</span> <span class="token string">&quot;)&quot;</span> -print <span class="token operator">|</span> <span class="token function">xargs</span> <span class="token function">wc</span> -l\n\n<span class="token comment"># output &gt;</span>\n<span class="token number">423</span> a.js\n<span class="token number">1842</span> b.vue\n<span class="token number">52</span> c.html\n<span class="token number">7253</span> total\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br></div></div><h1 id="vscode查看" tabindex="-1"><a class="header-anchor" href="#vscode查看" aria-hidden="true">#</a> VsCode查看</h1><p>直接在vscode的全局搜索中（快捷键为Command + Shift + c），输入<code>b*[^:b#/]+.*$</code>，并使用<code>Use Regular Expression</code>选项（即最右侧的星号和方块的按钮），进行搜索,即可查看</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token comment"># input &gt;</span>\nb*<span class="token punctuation">[</span>^:b<span class="token comment">#/]+.*$</span>\n\n<span class="token comment"># output &gt;</span>\n<span class="token number">7253</span> results <span class="token keyword">in</span> <span class="token number">77</span> files\n\n<span class="token number">423</span> a.js\n<span class="token number">1842</span> b.vue\n<span class="token number">52</span> c.html\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br></div></div><p><img src="https://cdn.jsdelivr.net/gh/LeeDebug/PicGo/img/20210305125911.png" alt="VsCode查看代码行数"></p><h1 id="祝君无bug" tabindex="-1"><a class="header-anchor" href="#祝君无bug" aria-hidden="true">#</a> 祝君无Bug~</h1>',9),t={},p=(0,a(3744).Z)(t,[["render",function(n,s){return e}]])}}]);